    const loadImages = images.map((image, index) => <ImageContainer onMouseLeave={() => console.log(image)} key={`image-${index}`} onClick={() => { console.log(image) }}><ImageComponent src={image} /></ImageContainer>)
    return (
        <ImagesPreview>
            <ImageComponent>
                {loadImages}
            </ImageComponent>
        </ImagesPreview>

    );
}

